import React from 'react';
import SigendOutMain from '../Main/SignedOutMain';
import SignedInMain from '../Main/SignedInMain';

class Main extends React.Component{
    render() {
        if(this.props.signedIn){
            return (
                <div className="signedInMain">
                    <SignedInMain auth={this.props.auth} selection={this.props.selection}/>
                </div>   
            )
        }else {
            return (
                <div className="signedOutMain">
                    <SigendOutMain openForm={this.props.openForm} logIn={this.props.logIn}/>
                </div>
            )
        }
    }
}

export default Main;
